import {useEffect} from "react"

export default function LocationDropdown(props){
    const allDropdownElements = props.listOfLoc.map.slice(locationData =>{
        return(
            <p className="location-dropdown-element">{locationData.name}, {locationData.region}</p>
        )

    })

    return(
        <div className="location-dropdown">
            {allDropdownElements}
        </div>
    )
}
